import React from 'react';
import {Link} from 'react-router-dom';
import Navbar from '../components/Navbar';

const Home = ({ username, handleLogout }) => {
  return (
    <div className="min-h-screen flex flex-col">
      <Navbar username={username} handleLogout={handleLogout} />
      <div className="flex-grow flex flex-col items-center justify-center text-center mt-16">
        <h1 className="text-5xl font-bold text-gray-800 mb-4">Welcome!</h1>
        <p className="text-lg text-gray-600 mb-8">This is a basic template of a full-stack app.</p>
        <div className="space-y-4">
          <Link to="/login" className="block bg-blue-500 hover:bg-blue-600 text-white px-6 py-3 rounded-lg text-xl">Login</Link>
          <Link to="/register" className="block bg-green-500 hover:bg-green-600 text-white px-6 py-3 rounded-lg text-xl">Register</Link>
        </div>
      </div>
    </div>
  );
};

export default Home;
